CREATE DATABASE IF NOT EXISTS fifa26;
USE fifa26;

-- Table ligas
CREATE TABLE IF NOT EXISTS ligas (
    id INT PRIMARY KEY,
    nombre VARCHAR(200),
    nivel INT
);

-- Table equipos
CREATE TABLE IF NOT EXISTS equipos (
    id INT PRIMARY KEY,
    nombre VARCHAR(200),
    liga_id INT,
    FOREIGN KEY (liga_id) REFERENCES ligas(id)
);

-- Table jugadores
CREATE TABLE IF NOT EXISTS jugadores (
    id INT PRIMARY KEY,
    nombre_corto VARCHAR(150),
    nombre_largo VARCHAR(300),
    edad INT,
    fecha_nacimiento DATE,
    altura_cm INT,
    peso_kg INT,
    valor_eur BIGINT,
    salario_eur BIGINT,
    media INT,
    potencial INT,
    pie_preferido VARCHAR(20),
    weak_foot INT,
    skill_moves INT,
    internacional_reputacion INT,
    posicion VARCHAR(100),
    work_rate VARCHAR(100),
    body_type VARCHAR(100),
    release_clause_eur BIGINT,
    nacionalidad VARCHAR(150),
    equipo_id INT,
    FOREIGN KEY (equipo_id) REFERENCES equipos(id)
);

-- Table estadisticas_jugadores
CREATE TABLE IF NOT EXISTS estadisticas_jugadores (
    jugador_id INT PRIMARY KEY,
    pace INT,
    shooting INT,
    passing INT,
    dribbling INT,
    defending INT,
    physic INT,
    attacking_crossing INT,
    attacking_finishing INT,
    attacking_heading_accuracy INT,
    attacking_short_passing INT,
    attacking_volleys INT,
    skill_dribbling INT,
    skill_curve INT,
    skill_fk_accuracy INT,
    skill_long_passing INT,
    skill_ball_control INT,
    movement_acceleration INT,
    movement_sprint_speed INT,
    movement_agility INT,
    movement_reactions INT,
    movement_balance INT,
    power_shot_power INT,
    power_jumping INT,
    power_stamina INT,
    power_strength INT,
    power_long_shots INT,
    mentality_aggression INT,
    mentality_interceptions INT,
    mentality_positioning INT,
    mentality_vision INT,
    mentality_penalties INT,
    mentality_composure INT,
    defending_marking_awareness INT,
    defending_standing_tackle INT,
    defending_sliding_tackle INT,
    goalkeeping_diving INT,
    goalkeeping_handling INT,
    goalkeeping_kicking INT,
    goalkeeping_positioning INT,
    goalkeeping_reflexes INT,
    goalkeeping_speed INT,
    FOREIGN KEY (jugador_id) REFERENCES jugadores(id)
);

-- Table partidos
CREATE TABLE IF NOT EXISTS partidos (
    id INT AUTO_INCREMENT PRIMARY KEY,
    liga_id INT,
    numero_jornada INT,
    temporada INT,
    equipo_local_id INT,
    equipo_visitante_id INT,
    goles_local INT,
    goles_visitante INT,
    fecha_partido DATETIME,
    FOREIGN KEY (liga_id) REFERENCES ligas(id),
    FOREIGN KEY (equipo_local_id) REFERENCES equipos(id),
    FOREIGN KEY (equipo_visitante_id) REFERENCES equipos(id)
);

